from collections import defaultdict, deque
def minJumps(arr: list[int]) -> int:
    m = len(arr)
    if m <= 2:
        return m - 1
    grid = defaultdict(deque)
    distance = {0 : 0}
    for i, num in enumerate(arr):
        grid[num].appendleft(i)
    stack = deque([(0, 0)])
    while True:
        pos, steps = stack.popleft()
        steps += 1
        if pos == m - 2: return steps
        if pos > 0 and ((not pos - 1 in distance) or distance[pos - 1] > steps):
            stack.append((pos - 1, steps))
            distance[pos - 1] = steps
        if pos < m - 1 and ((not pos + 1 in distance) or distance[pos + 1] > steps):
            distance[pos + 1] = steps
            stack.append((pos + 1, steps))
        for jump in grid[arr[pos]]:
            if jump == m - 1: return steps
            if jump == m - 2: return steps + 1
            if (not jump in distance) or distance[jump] > steps:
                stack.append((jump, steps))
                distance[jump] = steps
